import React from "react";

import "./format.styles.scss";

const Format = ({ positions }) => {
  return (
    <div className="format">
      <table>
        {console.log(positions)}
        {positions.map((position) => (
          <td>{position}</td>
        ))}
      </table>
    </div>
  );
};
export default Format;
